import React from "react";
import InputMask from "react-input-mask";

export default function InputComponent(props) {
    return (
        <label for={props.id}>
            <div className="info">{props.description}</div>
            <InputMask
                id={props.id}
                type={props.type}
                placeholder={props.placeholder}
                mask={props.mask}
                value={props.value}
                onChange={props.onChange}
            />
        </label>
    );
}
